for item in "${!DATA[@]}";
do
    read -r -a array0 <<< "$item"
    j=${array0[10]}
    unset "array0[10]"



    echo "INPUT: \"$item\". OUTPUT MUST BE: \"${DATA[$item]}\""
    RESULT="$(echo "${item}" | ./bin/exercise3 "$j" | sed -e 's/^[[:space:]]*//' -e 's/[[:space:]]*$//')"
    EXPECTED="${DATA[$item]}"

    for ((i=0; i<10; i++));
    do
        read -r -a array1 <<< "$EXPECTED"
        read -r -a array2 <<< "$RESULT"

        ERROR=$(echo "${array1[$i]}-(${array2[$i]})" | bc -l)
        if [ "$(echo "${ERROR#-}"'>'0.01 | bc -l)" -ne 0 ]; then
